import firebase from 'firebase';

const firebaseConfig = {
    apiKey: "AIzaSyCjTBBUn1bG4keC3RhGCm85yhpcflkuycA",
    authDomain: "rocketstart-careers.firebaseapp.com",
    projectId: "rocketstart-careers",
    storageBucket: "rocketstart-careers.appspot.com",
    messagingSenderId: "958503630998",
    appId: "1:958503630998:web:1c931317be89142734aab7",
    measurementId: "G-2LM4YX6DPC"
};

try {
    firebase.initializeApp(firebaseConfig);
}
catch (err) {
    if (!/already exists/.test(err.message)) {
        console.error('Firebase initialization error', err.stack);
    }
}

const fire = firebase;
export default firebase;
